/*
A dirty hack to overcome a weird color bug. it's ugly AF, no one cares
we need a pixel for each color we use for some reason
*/
export default function() {
    return (
        <span>
            <span className="border-red-500"></span>
            <span className="border-emerald-500"></span>
            <span className="border-orange-400"></span>
        </span>
    )
}
